      out.write("function Time(t) {\n");
      out.write("	t = new (function() {\n");
      out.write("	    // Stopwatch element on the page\n");
      out.write("	    var $stopwatch;\n");
      out.write("	    // Timer speed in milliseconds\n");
      out.write("	    var incrementTime = 70;\n");
      out.write("	    // Current timer position in milliseconds\n");
      out.write("	    var currentTime = 0;\n");
      out.write("	    // Start the timer\n");
      out.write("	    $(function() {\n");
      out.write("	        $stopwatch = $(\"#\"+t).find(\"div .cont_cell\");\n");
      out.write("	        console.log( $(\"#\"+t).find(\"div .cont_cell\").html());\n");
      out.write("	        t= $.timer(updateTimer, incrementTime, true);  \n");
      out.write("	    });\n");
      out.write("	    // Output time and increment\n");
      out.write("	    function updateTimer() {\n");
      out.write("	        var timeString = formatTime(currentTime);\n");
      out.write("	        //console.log( $stopwatch.html());\n");
      out.write("	        //console.log(timeString)\n");
      out.write("	        $stopwatch.html(timeString);\n");
      out.write("	        currentTime += incrementTime;\n");
      out.write("	    }\n");
      out.write("	    // Reset timer\n");
      out.write("	    this.resetStopwatch = function() {\n");
