      out.write("	});\n");
      out.write("}\n");
      out.write("\n");
      out.write("function formatTime(time) {\n");
      out.write("    time = time / 10;\n");
      out.write("    var min = parseInt(time / 6000),\n");
      out.write("        sec = parseInt(time / 100) - (min * 60),\n");
      out.write("        hundredths = pad(time - (sec * 100) - (min * 6000), 2);\n");
      out.write("    return (min > 0 ? pad(min, 2) : \"00\") + \":\" + pad(sec, 2) + \":\" + hundredths;\n");
      out.write("}\n");
      out.write("// Common functions\n");
      out.write("function pad(number, length) {\n");
      out.write("    var str = '' + number;\n");
      out.write("    while (str.length < length) {str = '0' + str;}\n");
      out.write("    return str;\n");
      out.write("}\n");
      out.write("//return yyyy-mm-dd hh:mm\n");
      out.write("function getFormatDate(date){\n");
      out.write("    var year = date.getFullYear();              //yyyy\n");
      out.write("    var month = (1 + date.getMonth());          //M\n");
      out.write("    month = month >= 10 ? month : '0' + month;  //month 두자리로 저장\n");
      out.write("    var day = date.getDate();                   //d\n");
      out.write("    day = day >= 10 ? day : '0' + day;          //day 두자리로 저장\n");
      out.write("    return  year+'-'+month+'-'+day;\n");
      out.write("}\n");
